script: |
  super -f text -I q8576.spq | sort > q8576.out

inputs:
  - name: q8576.spq
    data: |
      SELECT - 2 * + 19 AS col2 FROM tab1 (FORMAT parquet) WHERE - col1 * 14 NOT IN ( - + 95 + + + col1 * - + col1 + - col0, 16 );
  - name: tab1

outputs:
  - name: q8576.out
    data: |
      -38
      -38
      -38
